import React from 'react';
import one from '../assets/1.jpg'; 
import two from '../assets/2.jpg'; 
import th from '../assets/3.jpg';
import winer from '../assets/winer.json'
import Lottie from 'lottie-react';

const CourseDet = () => {
  return (
    <div className="m-4 p-2 pl-10 h-200 bg-white border-transparent hover:border-blue-500 border-gray-200 rounded-lg shadow-xl sm:p-4 dark:bg-gray-800 dark:border-gray-700">
       <div className="flex justify-center"> {/* Centering the content */}
        <div className="flex-1">
          <Lottie animationData={winer} style={{ width: '120px', height: '90px' }} /> {/* Decreased width and height */}
        </div>
      </div>
      <div className="flex items-center justify-between mb-2"> {/* Decreased mb-4 to mb-2 */}
        <h5 className="text-lg font-bold leading-none text-gray-900 dark:text-white">Winners</h5> {/* Decreased text size */}
      </div>
      <div className="flow-root">
        <ul role="list" className="divide-y divide-gray-200 dark:divide-gray-700">
          <li className="py-2 sm:py-3"> {/* Decreased py-3 to py-2 */}
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <img className="w-6 h-6 rounded-full" src={one} alt="Neil image" /> {/* Decreased width and height */}
              </div>
              <div className="flex-1 min-w-0 ms-2"> {/* Decreased ms-4 to ms-2 */}
                <p className="text-xs font-medium text-gray-900 truncate dark:text-white"> {/* Decreased text size */}
                  Temesgen M.
                </p>
               
              </div>
              <div className="inline-flex items-center text-sm font-semibold text-gray-900 dark:text-white"> {/* Decreased text size */}
                100 birr
              </div>
            </div>
          </li>

          <li className="py-2 sm:py-3"> {/* Decreased py-3 to py-2 */}
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <img className="w-6 h-6 rounded-full" src={one} alt="Neil image" /> {/* Decreased width and height */}
              </div>
              <div className="flex-1 min-w-0 ms-2"> {/* Decreased ms-4 to ms-2 */}
                <p className="text-xs font-medium text-gray-900 truncate dark:text-white"> {/* Decreased text size */}
                  Temesgen M.
                </p>
                
              </div>
              <div className="inline-flex items-center text-sm font-semibold text-gray-900 dark:text-white"> {/* Decreased text size */}
                100 birr
              </div>
            </div>
          </li>

          <li className="py-2 sm:py-3"> {/* Decreased py-3 to py-2 */}
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <img className="w-6 h-6 rounded-full" src={one} alt="Neil image" /> {/* Decreased width and height */}
              </div>
              <div className="flex-1 min-w-0 ms-2"> {/* Decreased ms-4 to ms-2 */}
                <p className="text-xs font-medium text-gray-900 truncate dark:text-white"> {/* Decreased text size */}
                  Temesgen M.
                </p>
                
              </div>
              <div className="inline-flex items-center text-sm font-semibold text-gray-900 dark:text-white"> {/* Decreased text size */}
                100 birr
              </div>
            </div>
          </li>

          <li className="py-2 sm:py-3"> {/* Decreased py-3 to py-2 */}
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <img className="w-6 h-6 rounded-full" src={one} alt="Neil image" /> {/* Decreased width and height */}
              </div>
              <div className="flex-1 min-w-0 ms-2"> {/* Decreased ms-4 to ms-2 */}
                <p className="text-xs font-medium text-gray-900 truncate dark:text-white"> {/* Decreased text size */}
                  Temesgen M.
                </p>
                
              </div>
              <div className="inline-flex items-center text-sm font-semibold text-gray-900 dark:text-white"> {/* Decreased text size */}
                100 birr
              </div>
            </div>
          </li>

          {/* Other list items with decreased sizes */}
        </ul>
      </div>
      <a href="#" className="block mt-2 text-xs font-medium text-center text-blue-600 hover:underline dark:text-blue-500"> {/* Added block and adjusted margin */}
        View all
      </a>
    </div>
  );
};

export default CourseDet;
